                </div>
            </section>
            <section style="left: 125px;position: absolute;top: 0px;">
                <div class="abc">
                    <span id="number" style="display: none;"></span>
                    <label onclick="second()" id="second"></label>
                </div>
            </section>
            <!-- <section title=".slideThree third" style="left: 125px;position: absolute;top: 0px;">
                <div class="slideThree">
                    <input type="checkbox" value="None" id="slideThree" name="check" checked />
                    <label for="slideThree"></label>

            <section title=".slideThree" style="left: 250px;position: absolute;top: 0px;">
                <div class="abc">
                    <label onclick="music()" id="music"></label>
                </div>
            </section>
        </div>
        <audio id="myAudio">
            <source id="source" src="" type="audio/mp3">
        </audio>
        <div class="progressbar">
            <div class="prog" id="progressbar"></div>
        </div>
    </div>
    <div style="position: absolute;top: 900px;border: 2px solid red;width:300px;height: 20px;">
        After creating delete this..
    </div>
    <script>
        function both()
        {
            document.getElementById("svgid").style.fill = "white";
            document.getElementById("ratsvg").style.fill = "white";
            document.getElementById("ganesh").style.backgroundColor = "#300";
            document.getElementById("ganesh").style.backgroundImage = "radial-gradient(circle, #633, #000)";
        }
        function svgrat_normal()
        {
            document.getElementById("svgid").style.fill = "white";
            document.getElementById("ratsvg").style.fill = "white";
            console.log("White.");
        }
        function toogle() {
            var element = document.getElementById("music");
            element.classList.toggle("myaudio");
        }
        var player = document.getElementById('myAudio');
        myAudio.ontimeupdate = function () {
            var time = progressbar.style.width = Math.floor((myAudio.currentTime * 100) / myAudio.duration) + "%";
            const second = ["#ff00fe", "#63d0af", "#e7feff", "#03a9f4", "#9966ff", "#3ce894", "aqua", "#ff6262"];
            var randomcolor = second[Math.floor(Math.random() * second.length)];
            const background = ["#010D3E", "#331818", "#093028", "#000428", "#1F1C18"];
            var backcolor = background[Math.floor(Math.random() * background.length)];
            per = time.replace(/%/, "");
            console.log(per);
            if (per >= 0 && per < 100) {
                document.getElementById("svgid").style.fill = randomcolor;
                document.getElementById("ratsvg").style.fill = randomcolor;
                document.getElementById("svgid").style.transition = "all 0.5s ease";
                document.getElementById("ratsvg").style.transition = "all 0.5s ease";
                document.getElementById("ganesh").style.backgroundColor = backcolor;
                document.getElementById("ganesh").style.transition = "all 0.5s ease";
                document.getElementById("ganesh").style.backgroundImage = "none";
            }
            else if (per === 0) {
                both();
                toogle();
            }
            else if (per >= 100) {
                both();
                toogle();
            }
        };
        function all() {
            document.getElementById("progressbar").style.backgroundColor = "white";            
            var rand = ['https://github.com/Lahulesh/Audio/raw/main/Shree%20Siddhivinayak%20-%20Ganesh%20arti.mp3', 'https://github.com/Lahulesh/Audio/raw/main/New%20Ganesh%20Ji%20(Ganesh%20Chaturthi).mp3','https://github.com/Lahulesh/Audio/raw/main/Ganesh%20Ji.mp3','https://github.com/Lahulesh/Audio/raw/main/Deva%20O%20Deva%20Ganpati%20Deva%20-%20Hindi%20Devotional%20Song.mp3','https://github.com/Lahulesh/Audio/raw/main/Jay%20Ganesh%20Jay%20Ganesh%20Deva%20-%20Ganesha%20Aarti.mp3'];
            var randSound = rand[Math.floor(Math.random() * rand.length)];
            var sourceMp3 = document.getElementById('source');
            sourceMp3.src = '' + randSound + '';
            player.load();
            player.play();
            console.log(randSound);
        }
        function music() {
            toogle();
            var audio = document.getElementsByTagName("label")[2].className;
            if (audio == "myaudio") {
                all();
            }
            else {
                player.pause();
                player.currentTime = 0;
            }
        }
        function bgganesh()
        {
            document.getElementById("ganesh").style.transition = "all 0.5s ease";
            document.getElementById("ganesh").style.backgroundImage = "none";
        }
        function bgganesh_normal()
        {
            document.getElementById("ganesh").style.backgroundColor = "#300";
            document.getElementById("ganesh").style.backgroundImage = "radial-gradient(circle, #633, #000)";
        }
        function first() {
            const checkbox = document.getElementById('slideThree')
            checkbox.addEventListener('change', (event) => {
                if (event.currentTarget.checked) {
                    const colors = ["#010D3E", "#331818", "#093028", "#000428", "#1F1C18"];
                    var bgcolor = colors[Math.floor(Math.random() * colors.length)];
                    document.getElementById("ganesh").style.backgroundColor = bgcolor;
                    bgganesh();
                } else {
                    bgganesh_normal();
                }
            })
        }
        function second() {
            var element = document.getElementById("second");
            element.classList.toggle("mystyle");
            var x = document.getElementsByTagName("label")[1].className;
            if (x === "mystyle") {
                var no = document.getElementById("number").innerHTML = "innercolor";
                const second = ["#ff00fe", "#63d0af", "#e7feff", "#03a9f4", "#9966ff", "#3ce894", "aqua", "#ff6262"];
                var fillcolor = second[Math.floor(Math.random() * second.length)];
                if (no === "innercolor") {
                    document.getElementById("svgid").style.fill = fillcolor;
                    document.getElementById("ratsvg").style.fill = fillcolor;
                    document.getElementById("svgid").style.transition = "all 0.5s ease";
                    document.getElementById("ratsvg").style.transition = "all 0.5s ease";
                }
            }
            else {
                svgrat_normal()
            }
        }
        function svgrat()
        {
            document.getElementById("svgid").style.fill = fillcolor;
            document.getElementById("ratsvg").style.fill = fillcolor;
            document.getElementById("svgid").style.transition = "all 0.5s ease";
            document.getElementById("ratsvg").style.transition = "all 0.5s ease";
        }
    </script>
